    return (
      <div>
        {Style}
        <div className="backimg">
          <div className="transparent">
            <h1 style={this.style}>Reactとは？</h1>
            <Footer go="./Page2" />
          </div>
        </div>
      </div>
    );
  }
}

export default App;
